// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SecureContract {
    mapping(address => uint256) public balances;

    // Allow users to deposit Ether into the contract
    function deposit() external payable {
        require(msg.value > 0, "Deposit amount must be greater than zero");
        balances[msg.sender] += msg.value;
    }

    // Allow users to withdraw their balance securely
    function withdraw() external {
        uint256 balance = balances[msg.sender];
        require(balance > 0, "Insufficient balance");

        // Reset balance before transferring to prevent reentrancy attacks
        balances[msg.sender] = 0;
        (bool success, ) = msg.sender.call{value: balance}("");
        require(success, "Transfer failed");
    }

    // Fallback function to prevent Ether transfers directly to the contract
    fallback() external payable {
        revert("Fallback function: No Ether accepted");
    }

    receive() external payable {
        revert("Receive function: No Ether accepted");
    }
}

